import React from 'react';
import PropTypes from 'prop-types';

import './player.scss';

const RegionBtn = ( {player} ) => {
  return (
    <div className="player">
      {player.nickname}
    </div>
  )
}

RegionBtn.propTypes = {
  player: PropTypes.objectOf({
    nickname: PropTypes.string.isRequired,
  })
}

export default RegionBtn;
